import React from 'react';
import './button.css';

const Button = ({ onClick, type }) => {

    const buttonStyle = {
        background: type === "confirm" ? '#0A8AE8' : type === "cancel" ? 'none' : '#0A8AE8'
    }

  return (
    <div className='button'>
        <p className='button-text'></p>
    </div>
  )
};

export default Button;
